import React from "react";
import Header from "./components/header";
import Body from "./components/body";
import Footer from "./components/footer";

import ContactFunctions from "./components/events/contactFunctions";
import Contact from "./components/events/contact";

export default class App extends React.Component {
  constructor(props) {
    super(props);

    this.Contact = new Contact();
    this.deleteItem = this.deleteItem.bind(this);
  }

  createContact(name, number) {
    let item = new ContactFunctions(name, number);
    let items = this.Contact.add(item);

    this.setState({ items: items });
  }

  deleteItem(item) {
    let items = this.Contact.delete(item);
    this.setState({ items: items });
  }
  render() {
    return (
      <React.Component>
        <Header />
        <Body />
        <Footer createContact={this.createContact} />
      </React.Component>
    );
  }
}
